import React from 'react'

function TodoList(props) {
    console.log(props);
    function editProduct(value) {
        setEdit(true);
        setOpenForm(true);
        setForm(value)

    }
    async function deleteProduct(id) {
        await deleteData(id);
        getAllProducts();
    }
  return (
    <div>
        {
            props.products.map((todoitem) => {
                return (
                    <>
                <li>{todoitem.todo}</li>
                <button className='btn btn-primary m-1' onClick={() => editProduct(todoitem)}>Edit</button>
                <button className="btn btn-danger m-1" onClick={() => deleteProduct(todoitem.id)}>Delete</button>
                </>
            )
            })
        }
    </div>
  )
}

export default TodoList
